import { defineStore } from "pinia";
import { useMemberStore } from "./member";
import { getToken } from "src/utils/cookies";
import { api } from "boot/axios.js";
import { ref } from "vue";

export const useCvStore = defineStore(
  "cv",
  () => {
    const questions = ref([]);
    const audios = ref([]);
    const cvLists = ref([]);
    const loading = ref(false);
    const pageLoading = ref(false);
    const pageCount = ref(0);

    function bearerToken(token) {
      return "Bearer " + token;
    }
    /*
    async function generateQuestions(
      questionNum,
      content,
      additionalQuestions,
    ) {
      questions.value = [
        {
          question:
            "문제해결능력을 기르기 위해 사용한 구체적인 전략에 대해 설명해 주시겠어요?",
          audio:
            "",
        },
      ];
    }
    */

    async function generateQuestions(
      questionNum,
      content,
      additionalQuestions,
    ) {
      questions.value = [];
      audios.value = [];

      const questionCreateAPI = `http://ec2-3-39-165-26.ap-northeast-2.compute.amazonaws.com:8080/question/create`;
      const accessToken = bearerToken(getToken());

      const cvObj = {
        questionNum,
        content,
        job: "sw개발", // tmp job scope
        additionalQuestions,
        additionalQuestionsSequence: additionalQuestions.map(
          (elem, index) => index, // tmp index
        ),
      };

      loading.value = true;
      try {
        const response = await fetch(questionCreateAPI, {
          method: "POST",
          headers: {
            "Content-Type": `application/json`,
            Authorization: accessToken,
          },
          body: JSON.stringify(cvObj),
        });

        const json = await response.json();
        console.log(json);

        if (json.result === "success") {
          questions.value = JSON.parse(json.body);
        } else throw new Error("질문 생성 에러");
      } catch (error) {
        console.log(error);
      } finally {
        loading.value = false;
      }
    }

    async function fetchAllCv(page, size) {
      cvLists.value = [];
      const accessToken = bearerToken(getToken());

      pageLoading.value = true;
      try {
        const res = await api.get(
          `/selfIntroduction/list?page=${page}&size=${size}`,
          {
            headers: {
              Authorization: accessToken,
            },
          },
        );

        pageLoading.value = false;
        if (res.data.result === "success" && res.status === 200) {
          console.log(res);
          cvLists.value = res.data.body.list;
          pageCount.value = res.data.body.pageCount;
          console.log(pageCount.value);
        } else throw new Error("fetch Cv erorr");
      } catch (err) {
        pageLoading.value = false;
        console.log(err);
      }
    }

    function addCv(title, content) {
      return new Promise((resolve, reject) => {
        const userId = useMemberStore().userId;
        const accessToken = bearerToken(getToken());

        const cvObj = {
          title,
          userId,
          content,
        };

        loading.value = true;
        api
          .post("/selfIntroduction/save", JSON.stringify(cvObj), {
            headers: { Authorization: accessToken },
          })
          .then((res) => {
            console.log(res);
            resolve(true);
          })
          .catch((err) => {
            console.log(err);
            reject("자기소개서 등록에 실패했습니다.");
          })
          .finally(() => {
            loading.value = false;
          });
      });
    }

    /* reset 필요하면 만들어야 됨. */
    return {
      questions,
      cvLists,
      loading,
      pageLoading,
      pageCount,
      generateQuestions,
      fetchAllCv,
      addCv,
    };
  },
  {
    persist: true,
  },
);
